import 'dotenv/config';
import cors from 'cors';
import uuidv4 from 'uuid/v4';
import models from './models';

var express = require("express");
var app = express();

app.use(cors());
app.use(express.json());
app.use(express.urlencoded({ extended: true }));

app.use((req, res, next) => {
    req.context = {
        models,
        me: models.users[2] // session to fetch authenticated users
    }
    next();
});


app.listen(process.env.PORT, (req, res) => {
 console.log(`Server running on port ${process.env.PORT}`);
});

// get all students
app.get("/students", (req, res, next) => {
    res.send(Object.values(req.context.models.students));
});

// get specify student
app.get("/students/:studentId", (req, res) => {
    res.send(req.context.models.students[req.params.studentId]);
});

// post student
app.post("/students", (req, res) => {
    const id = uuidv4();
    const student = {
      id,
      name: req.body.name,
      class: req.body.class,
      userId: req.me
    };
    return res.send(student);
});

// delete student
app.delete('/students/:studentId', (req, res) => {
    var student = students[req.params.studentId];
    var response = {
        'message': 'Successfully Deleted',
        'status_code': 200,
        'data': student
    }
    return res.send(response);
});

app.get('/session', (req, res) => {
    return res.send(req.context.models.users[req.context.me.username])
})

